import React from "react";
import styled from "styled-components";
import { makeStyles } from "@material-ui/core/styles";
import { Grid, Paper } from "@material-ui/core";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';

const gridStyles = makeStyles((theme) => ({
  cardsContainer: {
    paddingTop: theme.spacing(3)
  },
  April: {
    fontWeight: 500,
    paddingBottom: theme.spacing(3)
  },
  media: {
    
  }
}));

const DateCardsContainer1 = styled.div`
  width: 285px;
  height: 500px;
  display: flex;
  flex-direction: column;
  border-radius: 25px;
  box-shadow: 0 2px 7px 1px rgba(31, 31, 31, 0.2);
  background-color: #1d1f21;
`;

export function DateCards(props) {

  const classes = gridStyles();

    return (
      <Container maxWidth="lg" className={classes.cardsContainer}>
        <Typography variant="h4" className={classes.April}>
          April
        </Typography>
        <Grid container spacing={3}>
          <Grid item xs={12} sm={6} md={4}>
            <Card className={classes.root}>
              <CardActionArea>
                <CardMedia 
                className={classes.media}
                image="/assets/pictures/CardImages/img01.jpg"
                title="Shoe1"
                />
              </CardActionArea>
            </Card>
          </Grid>
          <Grid item xs={12} sm={6} md={4}>
            
          </Grid>
          <Grid item xs={12} sm={6} md={4}>
            
          </Grid>
        </Grid>
      </Container>
    );
}
